import{_ as e,o as t,c as a,O as o}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 64.2-1912 Powers of custodian.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/64.2-1912.md","filePath":"vacode/64.2-1912.md"}'),r={name:"vacode/64.2-1912.md"},i=o('<h1 id="§-64-2-1912-powers-of-custodian" tabindex="-1">§ 64.2-1912 Powers of custodian. <a class="header-anchor" href="#§-64-2-1912-powers-of-custodian" aria-label="Permalink to &quot;§ 64.2-1912 Powers of custodian.&quot;">​</a></h1><p>A custodian, acting in a custodial capacity, has all the rights, powers, and authority over custodial property that unmarried adult owners have over their own property, which shall include but not be limited to those powers set forth in § <a href="http://law.lis.virginia.gov/vacode/64.2-105/" target="_blank" rel="noreferrer">64.2-105</a> as of the date the custodian acts, but a custodian may exercise such rights, powers, and authority in that capacity only. However, this section does not relieve a custodian from liability for breach of a duty imposed under § <a href="http://law.lis.virginia.gov/vacode/64.2-1911/" target="_blank" rel="noreferrer">64.2-1911</a>.</p><p>1988, c. 516, § 31-49; 2012, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0614" target="_blank" rel="noreferrer">614</a>.</p>',3),s=[i];function n(c,d,l,h,_,p){return t(),a("div",null,s)}const v=e(r,[["render",n]]);export{f as __pageData,v as default};
